import React  from 'react';

import EventSidebarMain from './EventSidebarMain';


const EventSidebar = () => {

    return (
        <>
          

            <div class="react-wrapper">
                <div class="react-wrapper-inner">
                   

                    <EventSidebarMain />

                   
                </div>
            </div>

          

        </>
    );
}

export default EventSidebar;
